import React from 'react'
import { Route, Routes } from 'react-router-dom'
import AllQuoteTest from './AllQuoteTest'
import QuoteDetTest from './QuoteDetTest'

function QuoteTest() {
  return (
    <div>
      <Routes>
        <Route path={"/"} element={<AllQuoteTest />} />
        <Route path={"/quote/:id"} element={<QuoteDetTest />} />
      </Routes>
    </div>
  );
}

export default QuoteTest
